('2011-07-24 16:12:35', '1640', '<font color="#FF0000"><b>Q: </b>Hello,  I have just completed my first 7 day meal plan.  The following are items I eat and supplement on a regular basis.  Trader Joes goat milk yogurt, Silk organic soy milk, homemade granola (recipe on theKitchenSink.com), and fresh cherries.  Supplements: Solaray cal-mag-zinx (2 to 3 tabs daily and Spectrum fish oil.  If these items cannot be added, please suggest comparable items.  This menue planning guide has been very helpful in attianing a balanced diet.  Thank you.    Beth<br>', 1),
